import React, { lazy, Suspense } from 'react';

const Footer = lazy(() => import('../components/Footer'));
const Navbar = lazy(() => import('../components/Navbar'));

const Layout = ({children}) => {
  return (
   <React.Fragment>
    <div className='container mt-3'>
    <Navbar/>
    <br />
    <main>{children}</main>
    <br/>
    <Footer/>
    </div>
   </React.Fragment>
  )
}

export default Layout
